import { Facebook, Instagram, MailOutline, Phone, Room, Twitter } from '@material-ui/icons';
import React from 'react';
import styled from "styled-components";
import { mobile } from '../responsive'


const Container=styled.div`
display: flex;
${mobile({flexDirection:"column"})};


`
const Left=styled.div`
flex:1;
display: flex;
padding: 20px;
flex-direction:column;
`
const Logo=styled.h1``
const Desc=styled.p`
margin: 20px 0px;
`
const SocialContainer=styled.div`
display: flex;
`
const SocialIcon=styled.div`
width: 40px;
height: 40px;
border-radius:50%;
color: white;
background-color: #${props=>props.color};
display: flex;
align-items: center;
justify-content: center;
margin-right: 20px;
`
const Center=styled.div`
flex:1;
padding: 20px;
${mobile({display:"none"})};

`
const Title=styled.h3`
margin-bottom: 20px;
`
const List=styled.ul`
margin: 0;
padding: 0;
list-style:none;
display: flex;
flex-wrap:wrap;
`
const ListItem=styled.li`
width: 50%;
margin-bottom: 10px;
`
const Right=styled.div`
flex:1;
padding: 20px;
${mobile({backgroundColor:"#fff8f8"})};

`
const ContactItem=styled.div`
margin-bottom: 20px;
display: flex;
align-items: center;`
const Payment=styled.img`
width:100%;`


const Footer = () => {
  return (
    <Container>
        <Left>
            <Logo>Roses.</Logo>
            <Desc>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Amet dolor assumenda minima repellat sed repudiandae illum exercitationem impedit ipsa corporis!
            </Desc>
            <SocialContainer>
                <SocialIcon color='385999'>
                    <Facebook/>
                </SocialIcon>
                <SocialIcon color='E4405F'>
                    <Instagram/>
                </SocialIcon>
                <SocialIcon color="55ACEE">
                    <Twitter/>
                </SocialIcon>
            </SocialContainer>
        </Left>
        <Center>
            <Title>Useful Links</Title>
            <List>
            <ListItem>Home</ListItem>
            <ListItem>Cart</ListItem>
            <ListItem>Man Fashion</ListItem>
            <ListItem>Woman Fashion</ListItem>
            <ListItem>Accessories</ListItem>
            <ListItem>My Account</ListItem>
            <ListItem>Order Tracking</ListItem>
            <ListItem>Wishlist</ListItem>
            <ListItem>Wishlist</ListItem>
            <ListItem>Terms</ListItem>
            </List>
        </Center>
        <Right>
            <Title>Contact</Title>
            <ContactItem>
             <Room style={{marginRight:"10px"}}/>   #11-03 Namita Suites, Singapore-5000044.
            </ContactItem>
            <ContactItem>
             <Phone style={{marginRight:"10px"}}/> +65 8888 8888
            </ContactItem>
            <ContactItem>
             <MailOutline style={{marginRight:"10px"}}/> contact@roses.shop
            </ContactItem>
            <ContactItem>
             <Payment src="https://i.ibb.co/Qfvn4z6/payment.png"/>
            </ContactItem>
        </Right>
    </Container>
  )
}

export default Footer
